from redis_client.redis import redis_clientfrom stores.Moyo.moyo_model import MoyoStorefrom tasks.client import celery_appurls = [    'https://www.moyo.ua/ua/acsessor/acsessor_for_comp/manipulators/wacom/?page=1',    'https://www.moyo.ua/ua/acsessor/acsessor_for_comp/manipulators/wacom/?page=2',]# need to add  'https://www.moyo.ua/ua/acsessor/acc_man_grafgicheski/wacom/'@celery_app.taskdef start_moyo():    moyo = MoyoStore(urls)    items = moyo.generate_info_from_moyo()    result = moyo.compare_data(items)    json_data = redis_client.transfer_to_json(result)    redis_client.save_data_in_redis(name='moyo', value=json_data)    return moyo.compare_data(items)